import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import HomeScreen from './pages/Home';
import Start from './pages/Start';
import {
  useFonts,
  Outfit_400Regular,
  Outfit_600SemiBold,
  Outfit_700Bold,
  Outfit_500Medium,
} from '@expo-google-fonts/outfit';

import {
  Fraunces_700Bold,
  Fraunces_600SemiBold,
} from '@expo-google-fonts/fraunces';
import * as Font from 'expo-font';
import Register from './pages/Register';
import Login from './pages/Login';
import React, { useState, useEffect, useContext } from 'react';
// import LottieView from 'lottie-react-native';
import { View, Text, StyleSheet } from 'react-native';
import theme, { colors } from './style.js';
import Announcements from './pages/Announcements';
import Header from './components/Header';
import SideMenu from './components/Menu';
import Donations from './pages/Donations';
import Appoitment from './pages/process/Appoitment';
import Form1 from './pages/process/Form1';
import Form2 from './pages/process/Form2';
import Form3 from './pages/process/Form3';
import Form4 from './pages/process/Form4';
import Form5 from './pages/process/Form5';
import Form6 from './pages/process/Form6';
import Announcement from './pages/Announcement';
import AddAnnouncement from './pages/AddAnnouncement';
import {
  AuthenticatedUserContext,
  AuthenticatedUserProvider,
} from './providers';

const Stack = createNativeStackNavigator();
export default function App() {
  const [fontsLoaded, setLoaded] = useState(false);
  const { user } = useContext(AuthenticatedUserContext);

  const customFonts = {
    Fraunces_600SemiBold,
    Fraunces_700Bold,
    Outfit_400Regular,
    Outfit_500Medium,
    Outfit_600SemiBold,
    Outfit_700Bold,
  };

  const loadFontsAsync = async () => {
    await Font.loadAsync(customFonts).then(() => setLoaded(true));
  };

  React.useEffect(() => {
    loadFontsAsync();
  }, []);

  if (!fontsLoaded) {
    return (
      <View>
        {/* <LottieView
          ref={(animation) => {
            this.animation = animation;
          }}
          style={{
            width: 400,
            height: 400,
            backgroundColor: '#ffffff',
          }}
          source={require('./assets/loading.json')}
          // OR find more Lottie files @ https://lottiefiles.com/featured
          // Just click the one you like, place that file in the 'assets' folder to the left, and replace the above 'require' statement
        /> */}
        <Text style={theme.Title}>Loading...</Text>
      </View>
    );
  }

  return (
    <AuthenticatedUserProvider>
      <NavigationContainer>
        <Stack.Navigator initialRouteName={user ? 'Donations' : 'Appoirment'}>
          <Stack.Screen name='Home' component={HomeScreen} />
          <Stack.Screen
            name='Announcements'
            component={Announcements}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerBackVisible: false,
              headerShown: false,
              exact: true,
            }}
          />
          <Stack.Screen
            name='AddAnnouncement'
            component={AddAnnouncement}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerBackVisible: false,
              // headerShown: false,
            }}
          />
          <Stack.Screen
            name='Donations'
            component={Donations}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerBackVisible: false,
              headerShown: false,
            }}
          />
          <Stack.Screen
            name='Appointment'
            component={Appoitment}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Announcement'
            component={Announcement}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              exact: true,
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form1'
            component={Form1}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form2'
            component={Form2}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form3'
            component={Form3}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form4'
            component={Form4}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form5'
            component={Form5}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form6'
            component={Form6}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Start'
            component={Start}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerShown: false,
            }}
          />
          <Stack.Screen
            name='Register'
            component={Register}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Login'
            component={Login}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Menu'
            component={SideMenu}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerBackVisible: false,
              headerShown: false,
            }}
          />
        </Stack.Navigator>
      </NavigationContainer>
    </AuthenticatedUserProvider>
  );
}
